import React, {Component} from 'react';

class Miniaboutui extends Component {
    render() {
        return (
            <div>
                <div className="row">
                    <div className="col-md-6 how-img">
                        <img src={this.props.uiimgtop}
                             className="rounded-circle img-fluid" alt="ui"/>
                    </div>
                    <div className="col-md-6">
                        <h4>{this.props.uititletop}</h4>
                        <p className="text-muted">{this.props.uicontenttop}</p>
                    </div>
                </div>
                <div className="row">
                    <div className="col-md-6">
                        <h4>{this.props.uititlebot}</h4>
                        <p className="text-muted">{this.props.uicontentbot}</p>
                    </div>
                    <div className="col-md-6 how-img">
                        <img src={this.props.uiimgbot}
                             className="rounded-circle img-fluid" alt="ui"/>
                    </div>
                </div>

            </div>
        );
    }
}

export default Miniaboutui;
